import React from 'react';
import {Link} from 'react-router-dom';

function LogIn() {
    return (
        <nav className = 'App-nav'>
            <Link to="/log-in">Log In</Link>
            <Link to="/log-out">Log Out</Link>
        </nav>
    )
}
export default LogIn;
